const tz = 'Europe/Kyiv';
const today = new Date().toLocaleDateString('en-CA', { timeZone: tz }); // 2025-12-08

return items.map(item => {
  const src = item.json.updatedAt || item.json.createdAt;
  const d = src ? new Date(src) : null;
  const localDate = d
    ? d.toLocaleDateString('en-CA', { timeZone: tz }) // 2025-12-08
    : '';
  const updatedToday = localDate === today;
  return {
    json: {
      ...item.json,
      updatedToday,
      parsedDateKyiv: localDate, // для отладки можно убрать
      todayKyiv: today           // для отладки можно убрать
    }
  };
});

const text = $json.message.reply_to_message.text || '';
// из текста запроса вытянем booking
const m = text.match(/букинга\s+([^\s)]+)/i);
const booking = m ? m[1] : '';
return [{ json: {
  chat_id: $json.message.chat.id,
  eta: $json.message.text,
  booking,
  row_number: $json.message.reply_to_message?.reply_markup?.inline_keyboard?.[0]?.[0]?.callback_data?.split('|')[2] || ''
}}];
